import React, { Component } from 'react';

class ReactReader extends Component {
  render() {

    let title = this.props.title
    let text = this.props.children

    return(
      <div>
        <h3>{title}</h3>
        <h5>{text}</h5>
      </div>
    );
  }
}

export default ReactReader; // Don’t forget to use export default!
